import Home from './components/HomePage/Home';
import Menu from './components/MenuPage/Menu';

import video1 from './content/video1.mp4';
import video2 from './content/video2.mp4';
import video3 from './content/video3.mp4';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom"; 

import './App.css';
function App() {
  return (
    <Router>
    <div className="container">

         <Home />
         </div>




      <Switch>
        <Route path="/menu">
          <Menu />
        </Route>
        <Route path="/">
          <Home />
        </Route>
      </Switch>
  </Router>
  );
}

export default App;
